import Header from "./components/Header";
import PxGroteskBold from "./fonts/PxGroteskBold.ttf";

const Index = () => (
  <div>
    <div>Hello</div>
    <Header />

    <style jsx global>{`
      @font-face {
        font-family: "PxGroteskBold";
        src: url("fonts/PxGrotesk-Bold.woff2") format("woff2"),
          url("fonts/PxGrotesk-Bold.woff") format("woff"),
          url("fonts/PxGroteskBold.ttf") format("truetype ");
      }
      * {
        font-family: "PxGroteskBold";
      }
    `}</style>
  </div>
);

export default Index;
